Take 6 is an influential American a cappella gospel music sextet formed in 1985 on the campus of Oakwood College in Huntsville, Alabama. Take 6 sings in a contemporary style, integrating R&amp;B and jazz influences into their devotional songs. The group is based primarily in Nashville. All members grew up Seventh-Day Adventist.[citation needed] They won Grammy Awards in 1989, 1990, 1991, 1992, 1995, 1998, and 2003. They have collaborated with Stevie Wonder, Ray Charles, Queen Latifah, Joe Sample, Quincy Jones, Marcus Miller and Gordon Goodwin.
